def get_headers(header_raw):
  """
  通过原生请求头获取请求头字典
  :param header_raw: {str} 浏览器请求头
  :return: {dict} headers
  """
  return json.dumps(dict(line.split(": ", 1) for line in header_raw.split("\n")), indent=2)

def get_cookies(cookie_raw):
    """
    通过原生cookie获取cookie字段
    :param cookie_raw: {str} 浏览器原始cookie
    :return: {dict} cookies
    """
    return json.dumps(dict(line.split("=", 1) for line in cookie_raw.split("; ")), indent=2)



